import { Component } from '@angular/core';

@Component({
  selector: 'app-modal-content',

  templateUrl: './modal-content.component.html',
  styleUrls: ['./modal-content.component.css']
})
export class ModalContentComponent {
  constructor(private modalService: NgbModal) {} // Injection du service de modals

  openModal() {
    const modalRef = this.modalService.open(ModalContentComponent); // Ouverture du modal avec le composant de contenu modal
  }

}
